import React, { useState, useEffect } from 'react'
// import ArtList from './ArtList'

function ArtPage({ user }) {
  const [artworks, setArtworks] = useState([])

  useEffect(() => {
    fetch('http://[::1]:3000/artworks')
      .then(r => r.json())
      .then(artworksArray => setArtworks(artworksArray))
  }, [])


  const artList = 
    artworkArray.map((artwork) => {
      return  <ArtCart key={artwork.id} artwork={artwork} user={user}/>
    })

  return (
      <div>
         {artList}
      </div>
  );
}

export default ArtPage;
